import React from 'react';
import { useParams } from 'react-router-dom';

const BlogInfoPage = () => {
  const { id } = useParams();
  return (
    <div className="flex flex-col">
      <h2 className="text-2xl font-bold mb-4">Blog Information for Post {id}</h2>
      <p className="text-gray-600">This is some information about the blog post with ID {id}.</p>
    </div>
  );
};

export default BlogInfoPage;
